(function(){function ready(fn){if(document.readyState!=='loading'){fn();}else{document.addEventListener('DOMContentLoaded',fn);}}function getSelector(trigger){return trigger.getAttribute('data-target')||trigger.getAttribute('href');}function getTarget(trigger){var selector=getSelector(trigger);if(!selector)return null;if(selector.indexOf('#')===-1)return null;try{return document.querySelector(selector);}catch(e){return null;}}function setExpanded(trigger,expanded){if(!trigger)return;trigger.setAttribute('aria-expanded',expanded?'true':'false');trigger.classList.toggle('collapsed',!expanded);}function closeElement(el){if(el)el.classList.remove('in');}function openElement(el){if(el)el.classList.add('in');}function initCollapse(trigger){var target=getTarget(trigger);if(!target)return;trigger.addEventListener('click',function(event){event.preventDefault();var isOpen=target.classList.contains('in');var parentSelector=trigger.getAttribute('data-parent');if(parentSelector){var parent=document.querySelector(parentSelector);if(parent){parent.querySelectorAll('.collapse.in').forEach(function(open){if(open!==target){closeElement(open);var id=open.getAttribute('id');if(id){parent.querySelectorAll('[data-toggle="collapse"]').forEach(function(btn){var sel=getSelector(btn)||'';if(sel.indexOf('#'+id)!==-1)setExpanded(btn,false);});}}});}}if(isOpen){closeElement(target);setExpanded(trigger,false);}else{openElement(target);setExpanded(trigger,true);}});}function initDropdowns(scope){var dropdowns=[].slice.call(scope.querySelectorAll('.dropdown'));if(!dropdowns.length)return;dropdowns.forEach(function(dropdown){var toggle=dropdown.querySelector('.dropdown-toggle');if(!toggle)return;toggle.addEventListener('click',function(event){event.preventDefault();var open=dropdown.classList.contains('open');dropdowns.forEach(function(d){if(d!==dropdown)d.classList.remove('open');});dropdown.classList.toggle('open',!open);});});document.addEventListener('click',function(event){dropdowns.forEach(function(dropdown){if(!dropdown.contains(event.target))dropdown.classList.remove('open');});});}function initNavbar(navbar){var toggle=navbar.querySelector('.navbar-toggle');var target=toggle?getTarget(toggle):null;if(toggle)initCollapse(toggle);if(target){target.querySelectorAll('a').forEach(function(link){link.addEventListener('click',function(){if(target.classList.contains('in')){closeElement(target);setExpanded(toggle,false);}});});}initDropdowns(navbar);}ready(function(){document.querySelectorAll('[data-toggle="collapse"]').forEach(function(trigger){if(trigger.classList.contains('navbar-toggle'))return;initCollapse(trigger);});document.querySelectorAll('.navbar').forEach(initNavbar);});})();
